import React, { useEffect, useState } from 'react';

const data = 'https://first-express-project.herokuapp.com/movies';

export const Movie = () => {
  const [movies, setMovies] = useState([]);
  useEffect(() => {
    fetch(data)
      .then((res) => res.json())
      .then((json) => {
        setMovies(json.results);
      });
  }, []);
  return (
    <div>
      {movies.map((movie) => {
        return (
          <div>
            <h1>{movie.title} </h1>
          </div>
        );
      })}
    </div>
  );
};
